import React, { useState } from 'react';

const LoginPage = () => {
  const [email, setEmail] = useState('');

  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Handle the login logic here
    console.log(email);
  };

  return (
    <div className="flex justify-center items-center h-screen bg-cover bg-no-repeat bg-fixed" style={{ backgroundImage: "url('your-background-image-path.jpg')" }}>
      <div className="bg-white p-8 rounded shadow-md w-full max-w-sm">
        <h1 className="text-3xl text-red-600 font-bold mb-4">blocket</h1>
        <p className="mb-4">Logga in för en bättre upplevelse</p>
        <form onSubmit={handleSubmit}>
          <div className="mb-4">
            <label htmlFor="email" className="block text-gray-700 text-sm font-bold mb-2">
              Ange din e-postadress *
            </label>
            <input
              type="email"
              id="email"
              value={email}
              onChange={handleEmailChange}
              required
              className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
            />
          </div>
          <div className="mb-4">
            <button type="submit" className="w-full bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline">
              Fortsätt
            </button>
          </div>
        </form>
        <div className="text-sm text-gray-600">
          <p>Blocket är en del av Schibsted.</p>
          <p>Du behöver ett Schibsted-konto för att fortsätta.</p>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
